let fontPath = 'includes/fonts/RobotoMono-Regular.ttf',
	fg, bg, y = 0,
	w = 0,
	fc = 0,
	c = [0, 0, 255],
	rBox = 0,
	c1 = 0,
	c2 = 255,
	dx = 7,
	dy = 4,
	font;

function preload() {
	font = loadFont(fontPath);
}

function setup() {
	createCanvas(windowWidth, windowHeight, WEBGL);
	background(0);
	noFill();
	fill(255);
	noStroke();
	fg = createGraphics(width, height);
	bg = createGraphics(width, height);
	buildBox(fg);
	buildBox(bg);
	textFont(font);
	textSize(48);
	textAlign(CENTER, BOTTOM);
}

function draw() {
	background(0);
	orbitControl(5);

	rotateX(radians(0))
	rotateY(radians(sin(fc * .005) * 25));

	scale(.57)

	if(frameCount % 8 == 0) {
		y += 20;
		if(y > height) {
			y = 0;
			buildBox(fg);
			c = [random(255), random(255), random(255)];
			c1 = random(255);
			c2 = random(255);
			let dd = 4;
			dx = floor(random(1, dd));
			dy = floor(random(1, dd));
			buildBox(bg);
		}
		fg.fill(255);
		fg.noStroke();
		if(random(1) > .25)
			fg.rect(0, y, random(50, 250), 15);
	}

	bg.fill(c1);
	bg.stroke(c2);
	bg.strokeWeight(1);
	bg.ellipse(frameCount * dx % width, fc * dy % height, 50 + sin(fc * .03) * 250);

	push();
	translate(0, 0, -100)
	buildFont('p5.js', -width / 2)
	texture(bg);
	plane(bg.width, bg.height);
	pop();

	buildFont('ace-editor', -width / 2)
	texture(fg);
	plane(fg.width, fg.height);

	fc++;
}

function buildBox(pg) {
	pg.clear();
	pg.noFill();
	pg.stroke(255);
	pg.strokeWeight(3);
	pg.rect(1, 1, pg.width - 2, pg.height - 2);
}

function buildFont(txt, xoff) {
	push();
	let yoff = 50;
	let slant = 50;
	translate(xoff, -height / 2);
	fill(255);
	noStroke();
	text(txt, -slant, -yoff);

	stroke(255);
	line(0, 0, -slant, -yoff);
	noStroke();

	pop();
}

