function setup() {
	createCanvas(windowWidth, windowHeight);
	mouseX = width * 0.4;
}

function draw() {
	background(200);
	let lc = 20;
	fill(0);
	for(let i = 0; i < lc; i++) {
		let s = width / lc;
		let x = map(i, 0, lc - 1, 0, width);
		let osc = sin((frameCount * .01) + i * map(mouseX, 0, width, 0, 5));
		let y = height / 2 + osc * abs(mouseY - height / 2);
		stroke(150);
		strokeWeight(2.1 - (osc * 2));
		line(x, y, x, 0);
		noStroke();
		ellipse(x, y, s, s);
	}
}

