function rPos(off) {
	let x = (sin(off + frameCount * v) * width / 3);
	let y = (cos(off + frameCount * v) * height / 3);
	return createVector(x, y);
}

/*	webgl_sphereBox // cc teddavis.org 2019	*/

let lc = 8;

function setup() {
	createCanvas(windowWidth, windowHeight, WEBGL);
	noCursor();
	noStroke();

}

function draw() {
	ortho();
	background(0);
	for(let i = 0; i < lc; i++) {
		for(let j = 0; j < lc; j++) {
			let mx = map(i, 0, lc - 1, -width / 2, width / 2);
			let my = map(j, 0, lc - 1, -height / 2, height / 2);

			boxsphere(mx, my);
		}
	}
}

function boxsphere(x, y) {
	push();
	translate(x, y);
	let mmx = map(mouseX, 0, width, -width / 2, width / 2);
	let mmy = map(mouseY, 0, height, -height / 2, height / 2);
	let roff = -dist(mmx, mmy, x, y) / 2;
	rotateY(radians(frameCount + mouseX));
	rotateX(radians(mouseY));
	let s = (width / lc / 2) + roff;

	fill(255);
	if(mouseIsPressed) {
		fill(0);
	}
	box(s);

	fill(0);
	if(mouseIsPressed) {
		fill(255);
	}
	sphere(s * 0.65);
	pop();
}

/*	slidersGrid // cc teddavis.org 2019	*/
/*	hide editor to adjust sliders		*/

let x, y, xoff, border, grid = 40;
let sGrid, sModular, sSize, sSpeed, sSizeSpeed, cbSize;

function setup() {
	createCanvas(windowWidth, windowHeight);
	noStroke();

	x = width * .05;
	y = height * .05;
	xoff = width * .4;
	buildGUI();
}

function draw() {
	background(0);

	let c = 0;
	for(let i = 0; i < width; i += grid) {
		for(let j = 0; j < height; j += grid) {
			fill(abs(sin(frameCount * sSpeed.value() / 1000 + c * sModular.value())) * 255);
			let s = grid;
			if(cbSize.checked()) {
				s = sin(c * sSpeed.value() / sSizeSpeed.value()) * grid;
			}
			ellipse(border + i, border + j, s)
			c++;
		}
	}

	drawLabel();
}

function buildGUI() {
	border = grid / 2;
	sGrid = createSlider(20, 100, grid);
	sGrid.position(x + xoff, y);
	sGrid.input(updateGrid);
	sSpeed = createSlider(2, 100, 10);
	sSpeed.position(x + xoff, y * 2);
	sModular = createSlider(0, 100, 11);
	sModular.position(x + xoff, y * 3);
	sSizeSpeed = createSlider(1, 4000, 100);
	sSizeSpeed.position(x + xoff, y * 4);
	cbSize = createCheckbox('', false);
	cbSize.position(xoff + x * .7, y * 4)
}

function updateGrid() {
	grid = sGrid.value();
	border = grid / 2;
}

function drawLabel() {
	fill(0, 200);
	rect(xoff + width * .02, height * .02, 200, 180, 20);

	fill(255, 200);
	text("GRID", xoff + x, y);
	text("SPEED", xoff + x, y * 2);
	text("MODULATE", xoff + x, y * 3);
	text("SIZE OFFSET", xoff + x, y * 4);
}

/*	textToPoints // cc teddavis.org 2019	*/

let font, points, bounds;

function preload() {
	font = loadFont('includes/fonts/RobotoMono-Regular.ttf');
}

function setup() {
	createCanvas(windowWidth, windowHeight);
	getPoints('P5L');
	stroke(255);
	rectMode(CENTER);
}

function draw() {
	background(0);
	translate(width / 2 - bounds.w / 2, height * .5 + bounds.h / 2);
	for(let i = 0; i < points.length; i++) {
		let pt = points[i];
		push();
		translate(pt.x, pt.y);
		rotate(radians(sin(frameCount * i * 0.00003) * 180));
		let w = dist(mouseX, mouseY, pt.x + width / 4, pt.y + height * .7) / 3;
		line(0, 0, w, w);
		pop();
	}
}

function getPoints(txt) {
	let s = width / txt.length;
	points = font.textToPoints(txt, 0, 0, s);
	bounds = font.textBounds(txt, 0, 0, s);
}

